import DataAccessService from "../../../services/axios-service";
import config from "../../../config";
import React from "react";

const MainSearch = () => {
  DataAccessService.listAll()
    .then((response) => {
      const homes = response.data;
      const cities = homes.map((home) => home.city);

      // Create a <ul> element
      const ul = document.createElement("ul");

      // Iterate over the cities and create <li> elements
      cities.forEach((city) => {
        const li = document.createElement("li");
        li.textContent = city;
        ul.appendChild(li);
      });

      // Append the <ul> element to the desired container in the document
      const container = document.getElementById("cityList"); // Replace with the actual ID or selector of the container
      container.appendChild(ul);
    })
    .catch((error) => {
      console.error("Error fetching cities:", error);
    });
};

export default MainSearch;
